measurements.description:
Sixteen flowers on one 83.5-cm arched inflorescence; 
  sepals and petals yellow overlaid light maroon, veined deep maroon midline, yellow picotee;
   lip bright yellow spotted deep burgundy basally, midlobe blotched and diffused deep burgundy apically, burgundy midline, yellow picotee,
side lobes spotted deep burgundy;
   column yellow suffused burgundy, striped burgundy ventrally, anther cap white; substance firm;
 texture matte.
